import React from "react";

const Game = () => {
    return (
        <div className="bg-gray-900 flex flex-col items-center h-screen">
            {/* Header section */}
            <div className="w-full text-center pt-3 space-y-3">
                <h1 className="text-white text-3xl font-sans">SWEdle</h1>
                {/* White line below h1 */}
                <div className="w-full border-t-4 border-white"></div>
            </div>

            {/* Additional content */}
            <div className="flex flex-col justify-center items-center flex-grow mt-24">
                    <p className="text-white font-sans">Created by Jonathan Oh</p>
            </div>
        </div>
    );
};

export default Game;
